import React from "react";
import { Button, View, Text, StyleSheet } from "react-native";

const Details = ({ navigation }) => {
  const styles = StyleSheet.create({
    containerDetails: {
      flex: 1,
      alignItems: "center",
      justifyContent: "center",
    },
  });

  return (
    <View style={styles.containerDetails}>
      <Text>Country: VARIABLE CON PAIS SELECCIONADO</Text>
      <Text>New Confirmed: 1</Text>
      <Text>Total Confirmed: 150</Text>
      <Text>New Death: 5</Text>
      <Text>Total Death: 456</Text>
      <Text>New Recovered:2</Text>
      <Text>Total recovered:20</Text><br></br>
      <Button title="Go to Home" onPress={() => navigation.navigate("Home")} />
      <br></br>
      <Button title="Volver" onPress={() => navigation.goBack()} />
      </View>
  );
};

export default Details;
